	(365, '### USAGE: .achievement add <achievement>\nAdd an achievement, specified by ID or link, to the targeted player.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(366, '### USAGE: .account set addon [<accountname>] <expansion>\nSets the specified account\'s, or targeted player\'s account\'s expansion level. 0 = WoW, 1 = TBC, 2 = WotLK.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(367, '### USAGE: .account set sec regmail <accountname> <email> <confirm email>\nReplaces the registration email on record for the specified account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(368, '### USAGE: .account set sec email <accountname> <email> <confirm email>\nReplaces the email on record for the specified account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(369, '### USAGE: .account set 2fa <accountname> <secret>\nProvide a base32 encoded secret to setup two-factor authentication for the account.\nSpecify \'off\' to disable two-factor authentication for the account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(370, '### USAGE: .account set seclevel [<accountname>] <level> [<realm>]\nSet the security level for the specified account, or the targeted player\'s account, to the specified level on the specified realm.\nCannot be used on self. Levels range from 0 (player) to 3 (administrator). Realm ID defaults to -1 (all realms).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(371, '### USAGE: .account set password <accountname> <password> <confirm password>\nChanges the password for the specified account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(372, '### USAGE: .account 2fa setup\nBegins setup of two-factor authentication for this account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(373, '### USAGE: .account 2fa remove <token>\nProvide a current 2FA token to disable two-factor authentication for this account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(374, '### USAGE: .account addon <expansion>\nSets this account\'s expansion level. 0 = WoW, 1 = TBC, 2 = WotLK.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(375, '### USAGE: .account create <name> <password> [<email>]\nCreates a new account with the specified password and email (if specified).', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(376, '### USAGE: .account delete <name>\nDeletes the specified account. Cannot be used on self while connected.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(377, '### USAGE: .account email <old email> <password> <new email> <confirm new email>\nChanges the email on record for this account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(378, '### USAGE: .account onlinelist\nShows a list of all currently-connected accounts.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(379, '### USAGE: .account lock country <on/off>\nWhile enabled, you will only be able to log in from IP addresses in your current country.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(380, '### USAGE: .account lock ip <on/off>\nWhile enabled, you will only be able to log in from your current IP address.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(381, '### USAGE: .account password <old password> <new password> <confirm password> [<email>]\nChanges the password for this account.\nWhether you need to specify your email address depends on the server settings.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(382, '### USAGE: .account\nPrints information about the current account.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(383, '### USAGE: .learn <spell> [all]\nTeaches the specified spell.\nIf \'all\' is specified, teaches all ranks of the spell instead.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(384, '### USAGE: .unlearn <spell> [all]\nRemoves the specified spell from the target\'s spellbook.\nIf \'all\' is specified, removes all ranks of the spell instead.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(385, '### USAGE: .learn my quests\nTeaches you any spells your class can obtain through class quests.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(386, '### USAGE: .learn my trainer\nTeaches you any spells you could currently train at your class trainer.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(387, '### USAGE: .learn all blizzard\nTeaches you all available Blizzard internal spells.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(388, '### USAGE: .learn all debug\nTeaches you a set of spells useful for testing raid encounters.\nYou shouldn\'t be using GM commands during testing - they can cause weird behavior on their own!', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(389, '### USAGE: .learn all crafts [<player>]\nTeaches the specified player, or target/self, all available professions and recipes', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(390, '### USAGE: .learn all default [<player>]\nTeaches the specified player, or target/self, all default spells for their race/class, as well as any quests they have unlocked through quests.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
	(391, '### USAGE: .learn all languages\nTeaches all available languages.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
