	(12204, '|cff00ff00Payment complete. You need to do log-out by character and change race for character.Do not forget to clear folder Cache after change race!|r', NULL, '|cff00ff00Payment validé. Vous devez vous déconnecter de votre personnage et changer de race. N\'oubliez pas d\'effacer le dossier Cache après avoir changé de race !|r', NULL, NULL, NULL, NULL, NULL, '|cff00ff00Оплата успешно произведена. Сделайте логаут и измените расу своего персонажа.Не забудьте после смены расы, выйти из игры и удалить из клиента папку Cache!|r'),
